import {FC} from "react";
import { useSelector } from "react-redux";
import styled from "styled-components";

const ArticlesSection = styled.div`
width:100%;
margin-top: 20px;
padding: 10px;
`

const MainTitle = styled.div`
font-size:18px;
width: 200px;
float: left;
`
const TopBarDiv = styled.div`
height: 40px;
`;

const FilterInput = styled.div`
float: right;
margin-top: 4px;
margin-right: 30px;
border-radius: 5%;
border-radius:5px;
`

const Followed = styled.div`
margin-right: 20px;
float:right;
`

const FollowedIcon = styled.img`
width:25px;
`

const FollowedText = styled.text`
margin-top: 5px;
vertical-align: super;
margin-left: 5px;
`
const Articles: FC = () =>{

return(
        <ArticlesSection>
            <TopBarDiv>
                <MainTitle>
                    Resume Your work
                </MainTitle>
                <Followed><FollowedIcon src={'./media/icons/sensor.png'}/><FollowedText>Followed</FollowedText></Followed>
                <FilterInput>
                    <input type="text" style={{width:"125px", height: "20px", marginTop: "-5px", borderRadius: "5px", borderColor: "gray"}}/>
                    <img src="./media/icons/search.png" style={{marginLeft:" -22px", position: "absolute"}} alt=""></img>
                </FilterInput>
            </TopBarDiv>

        </ArticlesSection> 
    )
}
export default Articles
